import React, { Component } from 'react';

class Projects extends Component {
  constructor(props) {
    super(props);
    this.state = { activeTav: 0 };
  }
  render() {
    return(
      <div>
        <h1>
          Projects page
        </h1>
      </div>
    );
  }
}

export default Projects;
